define view entity ZTAX_DDL_I_BRF_SUBHEAD
  as select from ztax_t_mk2s

  association        to parent ZTAX_DDL_I_BRF_HEADER as _Header       on  $projection.CompanyCode = _Header.CompanyCode
                                                                      and $projection.Refrection1 = _Header.Refrection1
  association [1..1] to ZTAX_DDL_I_BRF_COMPANY_CODE  as _CompanyCodes on  $projection.CompanyCode = _CompanyCodes.CompanyCode
  composition [0..*] of ZTAX_DDL_I_BRF_NODE          as _Node
{
  key bukrs  as CompanyCode,
  key kiril1 as Refrection1,
  key kiril2 as Refrection2,
      _Header,
      _Node ,
      _CompanyCodes
}
